(289, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2017/03/wordpress-4-7-3-security-and-maintenance-release/''>WordPress 4.7.3 Security and Maintenance Release</a> <span class="rss-date">March 6, 2017</span><div class="rssSummary">WordPress 4.7.3 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.7.2 and earlier are affected by six security issues: Cross-site scripting (XSS) via media file metadata.  Reported by Chris Andrè Dale, Yorick Koster, and Simon P. Briggs. Control characters can trick redirect [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wptavern.com/in-case-you-missed-it-issue-18''>WPTavern: In Case You Missed It – Issue 18</a></li><li><a class=''rsswidget'' href=''https://ma.tt/2017/03/review-from-plato-to-post-modernism/''>Matt: Review: From Plato to Post-modernism</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/open-source-in-brazil-ebook-now-available-for-free''>WPTavern: “Open Source in Brazil” eBook Now Available for Free</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Popular Plugin:</span> UpdraftPlus WordPress Backup Plugin&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=updraftplus&amp;_wpnonce=452bee4b5b&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Install UpdraftPlus WordPress Backup Plugin">(Install)</a></li></ul></div>', 'no'),
